getPSDEDataQueryCodeConds.customCond:
( t1.product IN (
			SELECT
				t.`id` 
			FROM
				zt_product t 
			WHERE
				t.`deleted` = '0' 
				AND (
					t.`acl` = 'open' 
					OR (
						(
							t.`acl` = 'private' 
							AND (
								t.`updateby` = #{srf.sessioncontext.srfloginname}  
								OR t.`createdby` = #{srf.sessioncontext.srfloginname} 
								OR t.`qd` =#{srf.sessioncontext.srfloginname} 
								OR t.`rd` = #{srf.sessioncontext.srfloginname} 
								OR t.`po` = #{srf.sessioncontext.srfloginname} 
							) 
						) 
						OR ( t.id IN ( SELECT t.root FROM zt_team t WHERE t.account =#{srf.sessioncontext.srfloginname}  AND t.type = 'product' ) ) 
					) 
				) 
) )

(t1.id IN ( select tt3.story from zt_release  tt1 
LEFT JOIN zt_build tt2 on tt1.build = tt2.id  
LEFT JOIN zt_projectstory tt3 on tt3.project = tt2.project
where tt1.id =  #{srf.datacontext.release}
)  or (select tt2.project from zt_release  tt1 
LEFT JOIN zt_build tt2 on tt1.build = tt2.id where tt1.id =  #{srf.datacontext.release}
) = 0)
	AND t1.product =  #{srf.datacontext.product}
	AND not FIND_IN_SET (
t1.ID,(SELECT STORIES FROM ZT_RELEASE WHERE ID =  #{srf.datacontext.release}
))

